import Link from 'next/link';

const linkStyle = {
  marginRight: '20px',
};

const MyFirstView = () => (
  <section>
    <h1 className="title"> Comic Web </h1>

    <Link href='/characters'>
      <a style={linkStyle}>Characters</a>
    </Link>

    <Link href='/comics'>
      <a style={linkStyle}> Comics </a>
    </Link>

    <Link href='/series'>
      <a style={linkStyle}> Series </a>
    </Link>

  </section>
);

MyFirstView.Layout = ({children}) => <> {children} </>;


export default MyFirstView;
